import React, { useState } from "react";
import styled from "styled-components";

import DisplayCaption from './DisplayCaption';

const StyledLandingMain = styled.main`
grid-row: 2;
grid-column: 1;
display: grid;
grid-template-columns:34vw 66vw;
grid-template-rows: 50vh 42vh;
background: rgba(33,22, 11, 0.5);
section.section-right {
  grid-row: 1/3;
  grid-column: 2;
  display: grid;
  border: 1px solid #222;
  border-width: 0px;
  border-left-width: 1px;
  background: rgba(188, 255, 87, 0.3);
  & img {
    width: 95%;
    margin: auto;
    margin-bottom: 6vh;
  }
}
.section-left-bot {
  background: rgba(115, 234, 255, 0.3);
  padding: 10%;
  grid-row: 2/3;
  grid-column: 1;
  display: grid;
}
`;
const LandingMain = () => {

  return (
    <StyledLandingMain>
        <section className="section-right">
        <img
        src="https://www.dropbox.com/s/1ta1hqvv2eb5dgh/windows1_max.jpg?raw=1"
        alt="main lounge" />
      </section>
      <section className="section-left-bot">
        <DisplayCaption/>
      </section>
    </StyledLandingMain>
  );
};

export default LandingMain;
